import React, { useState } from "react";
import bgImg from "/Users/alokwaigaonkar/health_care/src/images/background.jpeg";

export default function Login() {
  const [userName, setUserName] = useState("");
  const [password, setPassword] = useState("");
  const [message,setMessage]=useState("")
    // const handleInputChange=(event)=>{
    //     event.preventDefault()
    //     const username=event.target.value;
    //     setUserName(username);
    //     const password=event.target.value;
    //     setPassword(password);
    // }
    const validateInfo=(username,password)=>{
        if(username.length>0 && password.length>0){
            return true;
            }
            else{
                return false;
                }
    }
    const handleSubmit=(event)=>{
        event.preventDefault()
        const username=event.target.value;
        setUserName(username);
        const password=event.target.value;
        setPassword(password);
        const validation=validateInfo(username,password);
        if(validation){
            setMessage("")
        }
        else{
            setMessage("Please enter both username and password")
        }

    }
  return (
    <>
      <div className="login">
        <img src={bgImg} alt="Login-bg" className="bg-img" />
        <div className="login-body">
          <div className="card login-card">
            <div className="card-body">
              <h1 className="login-title">Log In</h1>
              <form action="" className="login-form" onSubmit={handleSubmit}>
                <input
                  type="text"
                  name="username"
                  placeholder="Doc Id "
                  className="m-3 p-2 px-3 input-section"
                  style={{ borderRadius: "5px" }}

                />
                <input
                  type="password"
                  name="password"
                  placeholder="Doc Key"
                  className="m-3 p-2 px-3 input-section"
                  style={{ borderRadius: "5px" }}
                />

                <button type="submit" className="btn submit-button m-4 " >
                  Submit
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
